#include <stdio.h>
#include <math.h>
#include <stdlib.h>
#include <string.h>
#include "BigInteger.h"

int main(int argc, char* argv[])
{
	char* s1 = "";
	char* s2 = "-";
	char* r1 = "";
	char* r3 = "";
	char* r5 = "-";
	BigInteger A = stringToBigInteger(s1);
	BigInteger B = stringToBigInteger(s2);
	BigInteger C;
	
	BigInteger Result1 = stringToBigInteger(r1);
	BigInteger Result2 = sum(A, A);
	BigInteger Result3 = stringToBigInteger(r3);
	BigInteger Result4 = stringToBigInteger("0");
	BigInteger Result5 = stringToBigInteger(r5);

	printf("A:\n");
	printBigInteger(stdout, A);
	printf("\n\n");

	printf("B:\n");
	printBigInteger(stdout, B);
	printf("\n\n");

	int comp = compare(A, B);

	if(comp == -1)
	{
		printf("A < B\n\n");
		if(sign(A) == -1)
		{
			negate(A);
			comp = compare(A, B);
			if(comp == -1)
			{
				printf("A * -1 < B \n\n");
			}
			else
			{
				printf("A * -1 > B\n\n");
			}
			negate(B);
		}
	}
	else if(comp == 0)
	{
		printf("A = B\n\n");
	}
	else if(comp == 1)
	{
		printf("A > B\n\n");

		if(sign(B) == -1)
		{
			negate(B);
			comp = compare(A, B);
			if(comp == -1)
			{
				printf("A < B * -1\n\n");
			}
			else
			{
				printf("A > B * -1\n\n");
			}
			negate(B);
		}
			
	}

	C = sum(A, B);
	printf("A + B\n");
	if(equals(C, Result1))
	{
		printf("Correct!\n\n");
	}
	else
	{
		printf("Incorrect\n\n");
	}

	freeBigInteger(&C);
	C = copy(A);
	add(A, A, A);

	printf("A + A\n");
	if(equals(A, Result2))
	{
		printf("Correct!\n\n");
	}
	else
	{
		printf("Incorrect\n\n");
	}

	subtract(A, A, C);
	printf("2A - A\n");
	if(equals(A, C))
	{
		printf("Correct!\n\n");
	}
	else
	{
		printf("Incorrect\n\n");
	}

	freeBigInteger(&C);
	C = diff(A, B);

	printf("A - B\n");
	if(equals(C, Result3))
	{
		printf("Correct!\n\n");
	}
	else
	{
		printf("Incorrect\n\n");
	}

	freeBigInteger(&C);
	C = newBigInteger();
	subtract(C, B, B);
	printf("B - B\n");
	if(equals(C, Result4))
	{
		printf("Correct!\n\n");
	}
	else
	{
		printf("Incorrect\n\n");
	}

	freeBigInteger(&C);
	C = prod(A, B);
	printf("A * B\n");
	if(equals(C, Result5))
	{
		printf("Correct!\n\n");
	}
	else
	{
		printf("Incorrect\n\n");
	}

	makeZero(C);
	multiply(C, A, C);
	printf("A * 0\n");
	if(sign(C) == 0)
	{
		printf("Correct!\n\n");
	}
	else
	{
		printf("Incorrect\n\n");
	}

	freeBigInteger(&A);
	freeBigInteger(&B);
	freeBigInteger(&C);
	freeBigInteger(&Result1);
	freeBigInteger(&Result2);	
	freeBigInteger(&Result3);
	freeBigInteger(&Result4);
	freeBigInteger(&Result5);

	return (0);
}